import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './Component/Home/Home';

function App() {
  return (
    <Router>
    <Switch>

          <Route path="/home">
            <Home />
          </Route>
          <Route path="/dashboard">
            <Dashboard />
            <Route exact path="/">
            <Home />
          </Route>
          </Route>
        </Switch>

    </Router>
  );
}

export default App;
